import React, { useState, useEffect } from "react";
import axios from "axios";
import API_URL from "./config";
import "./App.css";

const App = () => {
  const [orderInfo, setOrderInfo] = useState({
    deliveryAddress: "",
    recipient: "",
    deliveryInstruction: "",
    paymentMethodId: "",
  });

  // 상품 목록을 관리하는 상태
  const [products, setProducts] = useState([]);

  const [paymentResult, setPaymentResult] = useState("");

  useEffect(() => {
    // 상품 목록을 불러오는 함수
    const fetchProducts = async () => {
      try {
        const response = await axios.get(`${API_URL}/products`);
        setProducts(response.data);
      } catch (error) {
        console.error("상품 데이터를 불러오는 중 오류가 발생했습니다:", error);
      }
    };
    fetchProducts();
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setOrderInfo({ ...orderInfo, [name]: value });
  };

  // 주문 제출 함수
  const submitOrder = async () => {
    try {
      const orderAmount = products.reduce(
        (total, product) => total + product.price * product.quantity,
        0
      );
      const response = await axios.post(`${API_URL}/orders`, {
        ...orderInfo,
        products: products.map((product) => ({
          productId: product.id,
          quantity: product.quantity,
        })),
        orderAmount,
      });

      if (response.status === 200) {
        setPaymentResult("주문이 성공적으로 처리되었습니다.");
      } else {
        setPaymentResult("주문 처리 중 오류가 발생했습니다.");
      }
    } catch (error) {
      console.error("주문 처리 중 오류가 발생했습니다.", error);
      setPaymentResult("주문 처리 중 오류가 발생했습니다.");
    }
  };

  return (
    <div className="app">
      {/* 배송 정보 입력 폼 */}
      {/* 상품 목록 및 구매 정보 */}
      <div className="order-form">
        {/* 기존 배송 정보 입력 폼 및 상품 목록 렌더링 코드 */}
        <h3>상품 목록</h3>
        {products.map((product, index) => (
          <div key={index} className="product">
            <h4>
              {product.name} - {product.price}원
            </h4>
            <p>
              수량:{" "}
              <input
                type="number"
                value={product.quantity}
                onChange={(e) =>
                  handleProductQuantityChange(index, e.target.value)
                }
              />
            </p>
          </div>
        ))}
      </div>
      <div className="payment-button">
        <button onClick={submitOrder}>주문하기</button>
      </div>
      {paymentResult && <p>{paymentResult}</p>}
    </div>
  );
};

export default App;
